import React from 'react';

import PromotionCard from './components/Address/Card/Card';
import './App.css';


const App = () => {
  const address = {
    "id": 1,
    "nome": "Casa BigVictory",
    "rua": "Barreirinha",
    "bairro": "Giberto Mestrinho",
    "numero": "628",
    "complemento": "Próximo ao merc. Rosa de Saron",
    "ponto de referência": "Baratão da Carne",
  }

  return (
    <div 
      className='App'
      style={{
        maxWidth: 500,
        margin: '30px auto',
      }}>
      <PromotionCard address={address}/>
    </div>
  )
}

export default App;
